import React, { Component } from 'react'
import PlanetDropdown from './components/PlanetDropdown'

export default class AllDropdown extends Component {
  render() {
    return (
      <PlanetDropdown
        planets={this.props.getFilteredPlanets('destination-1')}
        dropdownId='destination-1'
        selectItem={this.props.selectItem} />
    )
  }
}
